import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<div class="logo">
  <div>
    <p>navbar works!</p>
  </div>
  <div>
    <h1>HOLA</h1>
  </div>
  <div>
    <img src="assets/media/logo-sin-fondo.png" alt="mi imagen" />
  </div>
</div>
